import {
    SELECT_LAUNCHES
  } from '../types';

const launches = (state = {
    launches: null,
  }, action) => {
    switch (action.type) {
      case SELECT_LAUNCHES: {
        return {
          ...state,
          launches: action.launches,
        }
      }
    default:
        return state;
    }
}

export default launches;
